/** check if query contains candidate range */
private boolean contains(final byte[] range) {
  for (int d=0; d<numDims; ++d) {
    if (compareMinMin(range, d) > 0 || compareMaxMax(range, d) < 0) {
      return false;
    }
  }
  return true;
}

